import React from 'react';
import styled from 'styled-components';
import { FaMapMarkerAlt, FaClock, FaGraduationCap, FaCalendarAlt } from 'react-icons/fa';

// Image imports
import logo from './assets/logo.png';
import doctorImage from './assets/doctor.jpg';
import doctorProfile from './assets/medical.png';
import mapImage from './assets/map.jpg';
import calendarImage from './assets/may-calendar.png';
import stethoscopeImage from './assets/stethoscope.png';
import patientImage from './assets/patient.png';

// Service images
import backPain from './assets/back-pain.jpg';
import wristPain from './assets/wrist-joint-pain.jpg';
import slippedDisc from './assets/slipped-disc.jpg';
import neckPain from './assets/neck-pain.jpg';
import anklePain from './assets/ankle-joint-pain.png';
import headache from './assets/headache.jpg';
import kneePain from './assets/knee-pain.jpg';
import sportInjuries from './assets/sport-injuries.jpg';

const App = () => {
  // Services data with imported images
  const servicesData = [
    { id: 1, img: backPain, title: 'Back Pain Treatment' },
    { id: 2, img: wristPain, title: 'Joint Pain Treatment' },
    { id: 3, img: slippedDisc, title: 'Slipped Disc Treatment' },
    { id: 4, img: neckPain, title: 'Neck Pain Treatment' },
    { id: 5, img: anklePain, title: 'Joint Pain Treatment' },
    { id: 6, img: headache, title: 'Headache Treatment' },
    { id: 7, img: kneePain, title: 'Knee Pain Treatment' },
    { id: 8, img: sportInjuries, title: 'Sports Injuries Treatment' }
  ];

  // Patient resources data
  const resourcesData = [
    { 
      id: 1, 
      type: 'testimonial',
      img: patientImage,
      content: '"Dr. Rajeev Menon is truly a great doctor. He has lots of experience and his approach is very friendly."',
      author: '- Priya Mehta',
      buttonText: 'Read More'
    },
    { 
      id: 2, 
      type: 'faq',
      title: 'Frequently Asked Questions',
      items: [
        'How can I get my prescription?',
        'What should I bring to my appointment?',
        'What should I expect during my first checkup?'
      ],
      buttonText: 'View all'
    },
    { 
      id: 3, 
      type: 'calendar',
      title: 'Schedule an Appointment',
      img: calendarImage,
      icon: <FaCalendarAlt size={24} />
    },
    { 
      id: 4, 
      type: 'blog',
      title: 'Blog',
      img: stethoscopeImage,
      content: 'Understanding Chronic Pain',
      buttonText: 'Read more'
    }
  ];

  return (
    <GlobalStyles>
      <div className="App">
        <Header>
          <LogoContainer>
            <LogoImg src={logo} alt="RelivaWell logo"/>
            <LogoText>RelivaWell</LogoText>
          </LogoContainer>
          <Nav>
            <NavLink href="/">Home</NavLink>
            <NavLink href="/about">About</NavLink>
            <NavLink href="/services">Services</NavLink>
            <NavLink href="/resources">Resources</NavLink>
            <NavLink href="/contact">Contact</NavLink>
          </Nav>
          <AuthButtons>
            <LoginButton>Log In</LoginButton>
            <SignupButton>Sign Up</SignupButton>
          </AuthButtons>
        </Header>

        <Main>
          {/* Hero Section */}
          <HeroSection>
            <HeroContent>
              <HeroTitle>
                <span>Stop</span><strong> Guessing.</strong><br />
                <BlueText>Start </BlueText><strong>Healing.</strong>
              </HeroTitle>
              <HeroDescription>
                Personalized, compassionate care for chronic pain and fibromyalgia, and unexplained symptoms.
              </HeroDescription>
              <PrimaryButton>Start Your Healing Journey</PrimaryButton>
            </HeroContent>
            <HeroImage src={doctorImage} alt="Doctor consulting patient"/>
          </HeroSection>

          {/* Doctor Profile Section */}
          <DoctorSection>
            <DoctorContainer>
              <DoctorImage src={doctorProfile} alt="Dr. Rajeev Menon"/>
              <DoctorDetails>
                <DoctorName>Dr. Rajeev Menon</DoctorName>
                <DoctorSpecialty>Orthopaedic Surgery & Joint Pain</DoctorSpecialty>
                <DoctorQualification>
                  <FaGraduationCap /> MBBS MS(Orthopedics)
                </DoctorQualification>
                <DoctorExperience>
                  <FaClock /> 13 years experience
                </DoctorExperience>
